import React, { useState } from 'react';
import { View, Button } from 'react-native';
import IngredientesScreen from './screens/IngredientesScreen';
import OtraPantalla from './screens/OtraPantalla';

const App = () => {
  const [mostrarOtraPantalla, setMostrarOtraPantalla] = useState(false);

  const togglePantalla = () => {
    setMostrarOtraPantalla(!mostrarOtraPantalla);
  };

  return (
    <View style={{ flex: 1 }}>
      {!mostrarOtraPantalla ? (
        <IngredientesScreen />
      ) : (
        <OtraPantalla />
      )}

      <Button
        title={mostrarOtraPantalla ? 'Mostrar Ingredientes' : 'Mostrar Otra Pantalla'}
        onPress={togglePantalla}
      />
    </View>
  );
};

export default App;
